pragma solidity >= 0.5.0 < 0.7.0;
contract metro{

struct transaction{

	// State variables
	uint transaction_id;
	uint request_id;
	string amount;
	string fromplace;
	string toplace;
	string date;


}


transaction []m;



function add_transaction(uint transaction_id,uint request_id,string memory amount,string memory fromplace,string memory toplace,string memory date) public{
	transaction memory m1=transaction(transaction_id,request_id,amount,fromplace,toplace,date);
	m.push(m1);
}




}
